import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const RegisterPage = () => {
  const [formData, setFormData] = useState({
    username: "",
    password: "",
    email: "",
    firstName: "",
    lastName: "",
    dateOfBirth: "",
    address: {
      city: "",
      street: "",
      zipCode: "",
    },
  });
  const [error, setError] = useState("");
  const [success, setSuccess] = useState("");
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.startsWith("address.")) {
      const addressField = name.split(".")[1];
      setFormData((prev) => ({
        ...prev,
        address: {
          ...prev.address,
          [addressField]: value,
        },
        role: { name: "USER" },
      }));
    } else {
      setFormData((prev) => ({
        ...prev,
        [name]: value,
      }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    setSuccess("");

    try {
      const res = await axios.post("http://localhost:8080/admin/users", formData);
      setSuccess("✅ User registered successfully!");
      setTimeout(() => navigate("/"), 2000); // Redirect to login after 2 seconds
    } catch (err) {
      setError("❌ Registration failed: " + err.response?.data?.message || "Server error.");
    }
  };

  return (
    <div className="flex justify-center items-center h-screen bg-gray-100">
      <form
        onSubmit={handleSubmit}
        className="bg-white p-8 rounded shadow-md w-96 space-y-4"
      >
        <h2 className="text-2xl font-bold text-center">Register</h2>

        {error && (
          <div className="bg-red-100 text-red-700 text-sm p-2 rounded">
            {error}
          </div>
        )}
        {success && (
          <div className="bg-green-100 text-green-700 text-sm p-2 rounded">
            {success}
          </div>
        )}

        <input className="w-full border border-gray-300 p-2 rounded" placeholder="Username" name="username" value={formData.username} onChange={handleChange} />
        <input className="w-full border border-gray-300 p-2 rounded" type="password" placeholder="Password" name="password" value={formData.password} onChange={handleChange} />
        <input className="w-full border border-gray-300 p-2 rounded" placeholder="Email" name="email" value={formData.email} onChange={handleChange} />
        <input className="w-full border border-gray-300 p-2 rounded" placeholder="First Name" name="firstName" value={formData.firstName} onChange={handleChange} />
        <input className="w-full border border-gray-300 p-2 rounded" placeholder="Last Name" name="lastName" value={formData.lastName} onChange={handleChange} />
        <input className="w-full border border-gray-300 p-2 rounded" type="date" name="dateOfBirth" value={formData.dateOfBirth} onChange={handleChange} />
        <input className="w-full border border-gray-300 p-2 rounded" placeholder="City" name="address.city" value={formData.address.city} onChange={handleChange} />
        <input className="w-full border border-gray-300 p-2 rounded" placeholder="Street" name="address.street" value={formData.address.street} onChange={handleChange} />
        <input className="w-full border border-gray-300 p-2 rounded" placeholder="Zip Code" name="address.zipCode" value={formData.address.zipCode} onChange={handleChange} />

        <button
          type="submit"
          className="w-full bg-blue-500 text-white py-2 rounded hover:bg-blue-600"
        >
          Register
        </button>

        {/* ✅ Already have an account */}
        <div className="text-center text-sm text-gray-600">
          Already have an account?{" "}
          <span
            onClick={() => navigate("/")}
            className="text-blue-600 hover:underline cursor-pointer"
          >
            Login here
          </span>
        </div>

        {/* ✅ Back to homepage */}
        <button
          type="button"
          onClick={() => navigate("/")}
          className="w-full bg-gray-300 text-gray-800 py-2 rounded hover:bg-gray-400 mt-2"
        >
          🔙 Back
        </button>
      </form>
    </div>
  );
};
export default RegisterPage;
